const Projetos = () => {
  const projetos = [
    {
      id: 1,
      titulo: "Landing Page (TypeScript)",
      desc: "Página moderna desenvolvida em React + TypeScript.",
      img: "URL_DA_IMAGEM_DO_PROJETO_1",
    },
    {
      id: 2,
      titulo: "E-commerce Furniro",
      desc: "Frontend em TS + Backend NestJS/PostgreSQL.",
      img: "URL_DA_IMAGEM_DO_PROJETO_2",
    },
    {
      id: 3,
      titulo: "Petshop",
      desc: "Site completo com HTML, CSS e JavaScript.",
      img: "URL_DA_IMAGEM_DO_PROJETO_3",
    },
    {
      id: 4,
      titulo: "Landing Page Mr. Zeus",
      desc: "Landing page desenvolvida em TypeScript.",
      img: "URL_DA_IMAGEM_DO_PROJETO_4",
    },
  ];

  return (
    <section className="projetos" id="projetos">
      <h2 className="titulo-projetos">Projetos</h2>

      <div className="container-cards">
        {projetos.map((p) => (
          <div key={p.id} className="card">
            <div
              className="card-img"
              style={{ backgroundImage: `url(${p.img})` }}
            ></div>

            <div className="card-info">
              <h3>{p.titulo}</h3>
              <p>{p.desc}</p>
            </div>
          </div>
        ))}
      </div>
    </section>
  );
};

export default Projetos;
